import React, { Component } from 'react';
import ReactTable from 'react-table';
import 'react-table/react-table.css';
import '../AdminCss/adminparent.css';
import { Link } from 'react-router-dom';
import SideNav from "../../SideNavMenu";

class AdminParent extends Component {
    constructor(props) {
        super(props);

        this.state = {
            parents: []
        }
    }

    componentDidMount() {
        const url = "https://jsonplaceholder.typicode.com/posts";
        fetch(url, {
            method: "GET"
        }).then(res => res.json()).then(parents => {
            this.setState({ parents: parents })
        })
    }

    onDelEvent(id) {
        const index = this.state.parents.findIndex(parents => {
            return parents.id === id;
        })
        this.state.parents.splice(index, 1);
        this.setState({ parents: this.state.parents });
    }

    render() {
               
      let parents = this.state.parentss;
      let table_parents = parents.map((teachers, item) =>

          <tr key={item}>
              <td>{teachers.userId}</td>
              <td>{teachers.title}</td>
              <td>{teachers.id}</td>
              <td>{teachers.userId}</td>
              <td>{teachers.userId}</td>
              <td>{teachers.id}</td>
          </tr>
      );

        return (
            <div>
                <SideNav />
                <div style={{ paddingTop: '40px', paddingLeft: '60px', paddingRight: '20px' }}>
                    <div class='row '>
                        <div class='col-xl-8'>
                            <p class='text' >Guardian Records</p>
                        </div>

                        <div class='col-xl-4' >
                            <div style={{ textAlign: 'right', paddingRight: '10px', paddingTop: '10px' }}>
                                <Link to='adminaddparent'>
                                    <button class='btn btn-primary' >Add Guardian</button></Link>
                            </div>
                        </div>
                    </div>
                    <div class='col-l-12 reacttable' >

                        <div className='row'>

                            <div className='col-xl-6 col-sm-12'>
                                <label>Select Number of Row</label>
                                <div className='form-group'>
                                    <select name='state' id="maxRows" className='form-control' style={{ width: 150 }}>
                                        <option value='10000'>show all</option>
                                        <option vlaue='5'>5</option>
                                        <option vlaue='10'>10</option>
                                        <option vlaue='15'>15</option>
                                        <option value='20'>20</option>
                                    </select>
                                </div>
                            </div>
                            <div className='col-xl-6 col-sm-12 d-flex justify-content-end mt-4'>
                                <form>
                                    <div className="input-group">
                                        <input type="search" placeholder="Search Here..." className="form-control search_input" />

                                        <div className="input-group-append">
                                            <div className="input-group-text bg-primary">
                                                <div className="fas fa-search text-white"></div>
                                            </div>
                                        </div>
                                    </div>
                                </form>
                            </div>
                        </div>

                        <table className='table table-bordered table-striped table-sm-responsive' id="page">
                            <thead>
                                <tr>
                                    <th>Id</th>
                                    <th>Student Name</th>
                                    <th>Father Name</th>
                                    <th>Class</th>
                                    <th>Year</th>
                                    <th>Address</th>
                                </tr>
                            </thead>
                            <tbody className='parent    _table'>

                                {table_parents}


                            </tbody>
                        </table>

                        <div className='pagination-container'>
                            <nav>
                                <ul className='pagination'></ul>
                            </nav>
                        </div>

                    </div>

                </div>
            </div>

        )

    }
}


export default AdminParent;
